import React, {useState, Fragment} from 'react'

const Lista = () => {

    const [arrayNumero, setNumero] = useState([1,2,3,4,5,6])
    return (
        <Fragment>
            <h2>LISTA</h2>
            {
                arrayNumero.map((item, index) => 
                <p key={index}> {index}{item} -</p>
                )
            }   

        </Fragment>

    );
}

export default Lista;
